Esse governo:
1- Não tem espírito de liderança;
2- Não tem espírito de mansidão;
3- Não tem humildade;
4- Não tem sensibilidade;
5- Não tem respeito pelo povo brasileiro;
6- Não tem competência pra administrar o Brasil;
7- Não sabe se expressar;
8- Não governa para o todo;
9- NÃO MERECE MEU VOTO!
Por essas e outras meu voto é 13 ✌️♥️🙏🤩 É LULA DE NOVO !!!
